import ExpenseItem from './components/ExpenseItem'

function App() {
  const expenses = [
    {
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    },
    {
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    },
    {
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    }
  ];

  return (
    <div>
      <h1>My Todos</h1>
      <Todo text='Learn React' />
      <Todo text='섹션 1 학습' />

      <h2>Let's get started!</h2>
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
